import React from 'react';
import Dropdown from './Dropdown/Dropdown.js';
import './settings.css'

const Settings = ({ onRouteChange }) => {
	return (
		<div className="">
			<div className="settingsCard">
				<div className="lang-choice">
					<h3>Language: </h3>
					<Dropdown />
				</div>
			</div>
		</div>
	);
}

export default Settings;
